INSERT INTO `ow_project_description` VALUES ('acceleo','Acceleo is a code generator which uses the MDA approach to easily design applications with models. Acceleo is natively based on Eclipse EMF and can be extended to target any technology.',290,'2011-11-01 13:48:48'),('accord','Accord is the first open source Odette FTP 2.0 implementation, developed by Neociclo, providing functionalities to ease the integration of business partners with security and governance in mind. Project is licensed under GNU Affero GPL v3.',290,'2011-11-01 13:48:48'),('activexml','Active XML is a declarative framework based on XML documents with embedded calls to Web services that harnesses web services for data management and is put to work in a peer-to-peer architecture.',290,'2011-11-01 13:48:48'),('alitheia','The Alitheia Core tool is an extensible platform for software quality and evolution analysis that is extensible through simple plug-ins.',290,'2011-11-01 13:48:48'),('apollon','Generation engine able to build graphical user interfaces (GUI) from DTDs and customization models. This makes the GUIs adapted to the edition of XML documents.',290,'2011-11-01 13:48:48'),('aspire','The AspireRFID project aims at developing and promoting an open-source, lightweight, standards-compliant, scalable, privacy-friendly, and integrated middleware to ease the development, the deployment and the management of RFID-based applications.',290,'2011-11-01 13:48:48'),('barracudamvc','Barracuda is an open-source Presentation Framework designed to make it easier to build servlet based webapps by applying proven client-server patterns to the web development paradigm. It includes a DOM based templating mechanism for better separation',290,'2011-11-01 13:48:48'),('been','BEEN: Framework for Integrating Performance Evaluation in Development Cycle',290,'2011-11-01 13:48:48'),('bonita','Bonita Open Solution provides an intuitive and powerful Open Source BPM solution for simple to complex projects',290,'2011-11-01 13:48:48'),('bpmadmin','NovaBPM is reference open source BPM platform embedding Bonita XPDL Workflow and Orchestra BPEL projects',290,'2011-11-01 13:48:48'),('bsframework','The Bright Side Framework provides ready-to-use high level components to quickly build J2EE business applications accessed by rich java/Swing clients on HTTP.',290,'2011-11-01 13:48:48'),('c-jdbc','Clustered JDBC gives your applications a transparent (no code modification) access to a cluster of databases even if your database engines are not cluster-aware.',290,'2011-11-01 13:48:48'),('cardamom','CARDAMOM is a middleware framework that provides features to configure, deploy and execute near real-time, distributed and fault-tolerant applications.',290,'2011-11-01 13:48:48'),('carol','CAROL (Common Architecture for RMI Objectweb Layer) is a Java RMI (Remote Methods Invocation) management tool.',290,'2011-11-01 13:48:48'),('celtix','Celtix delivers a Java enterprise service bus (ESB) runtime and set of extensibility APIs, simplifying the construction, integration and flexible reuse of technical and business components using a standards-based, service-oriented architecture.',290,'2011-11-01 13:48:48'),('clif','CLIF provides a flexible, extensible Java-based platform for scalable, distributed load injection and performance testing. With the Eclipse-based GUI, use provided or custom load injectors and probes, and run up to millions of vUsers per injector!',290,'2011-11-01 13:48:48'),('cmi','CMI is a framework to enable clustering of all RMI objects. CMI aims to get scalability and high availability for RMI servers. Also, it ensures an up-to-date cluster view for clients and allows to change dynamically the algorithms of load-balancing.',290,'2011-11-01 13:48:48'),('director','Enhydra Director implements web server plugins for Apache, IIS and IPlanet supporting advanced load balancing / clustering and runtime administration. Director can be used with plain Tomcat, Jetty, JBoss, JOnAS or Enhydra Server.',290,'2011-11-01 13:48:48'),('dods','This project has moved to http://www.together.at/prod/database/tro . Please update your links !',290,'2011-11-01 13:48:48'),('dotnetj','DotNetJ is a middleware that gives .NET clients the ability to use Java components or J2EE applications. This project aims at providing .NET-to-Java interoperability without the bottleneck of web services.',290,'2011-11-01 13:48:48'),('dream','Dream is a component-based software framework dedicated to the construction of communication middleware. It provides a component library (based on Fractal) and tools allowing the construction of various communication paradigms.',290,'2011-11-01 13:48:48'),('dryverl','Dryverl is an XML dialect for specifying Erlang-to-C bindings as C port drivers, and a set of XSLT stylesheets that generate all of Erlang and C source code for a binding.',290,'2011-11-01 13:48:48'),('dysoweb','Dysoweb provides modularity and dynamicity to serlvet based web applications. Based on OSGi it allows the dynamic deployment of services packaged as bundles.',290,'2011-11-01 13:48:49'),('eaf','This project has moved to http://www.together.at/prod . Please update your links !',290,'2011-11-01 13:48:49'),('easywsdl','Easy WSDL Toolbox provides a simple and extensible library to handle  WSDL documents with a common and high level API. It handles both WSDL 1.1 or WSDL2.0',290,'2011-11-01 13:48:49'),('eclipse-update','This project is used to manage the ObjectWeb Consortium Eclipse update sites (download.[fr2,us,zh].forge.objectweb.org/eclipse-update) which allow Eclipse users to download ObjectWeb plugins directly from Eclipse.',290,'2011-11-01 13:48:49'),('edemos','This project has moved to http://www.together.at/prod . Please update your links !',290,'2011-11-01 13:48:49'),('enhydra','This project has moved to http://www.together.at/prod/server/tas . Please update your links !',290,'2011-11-01 13:48:49'),('entropy','Entropy is a virtual machine manager for clusters  which performs a globally optimized placement of virtual machines according to cluster resource usage and scheduler objectives.',290,'2011-11-01 13:48:49'),('epaf','This tool is an Eclipse plug-in based on EPF, which can define process aspects and weave them into SPEM 2.0 (Software Process Engineering Meta-model 2.0) process models.',290,'2011-11-01 13:48:49'),('federid','The FederID project aim to offer a real solution of Identity Management and Identity Federation. Built on existing free software, it profits of the support and the financing of the French National Agency of Research.',290,'2011-11-01 13:48:49'),('frascati','FraSCAti is a Java-based open source implementation of Service Component Architecture (SCA) specifications. Based on the OW2 Fractal component model, FraSCAti provides an open architecture to integrate new SCA component, binding, and intent technologies.',290,'2011-11-01 13:48:49'),('fwkdemoiselle','Demoiselle Framework is a Java Application Framework designed to accelerate the development of transactional database Web applications.',290,'2011-11-01 13:48:49'),('gasp','GASP project (GAming Services Platform) deals with middleware solutions to support Multiplayer Mobile Games (MMG) and Multiplayer Ubiquitous Games (MUGs), that implement and extends the Open Mobile Alliance GS specifications.',290,'2011-11-01 13:48:49'),('gotm','GoTM (GoTM is an open Transaction Monitor) is a component-based framework for building various transaction services. GoTM is developped with the Fractal component model.',290,'2011-11-01 13:48:49'),('howl','HOWL is a logger implementation providing features required by the JOTM project. HOWL uses unformatted binary logs to maximize performance and specifies a journalization API with methods necessary to support JOTM recovery operations.',290,'2011-11-01 13:48:49'),('interldap','InterLDAP is an identity management project based on a Java framework. Main goals are to solve self-management, provisioning, access control and profil management.',290,'2011-11-01 13:48:49'),('introspector','The introspector project aims to create a semantic interface into the GNU GCC compiler and other free tools. The data extracted will be useful for other object brokers. Currently hosted on sourceforge, we will be migrating the project to objectweb.',290,'2011-11-01 13:48:49'),('ivy','This project is used to manage the OW2\'s Ivy Repository (ivy.objectweb.org) which allows project managers using ivy to use a commmon repository.',290,'2011-11-01 13:48:49'),('j2ws','J2WS is a transforming tool to help develop web services efficiently. This project is hosted on the Trustie forge, operated by the OW2 China Local Chapter.',290,'2011-11-01 13:48:49'),('jac','Java Aspect Components (JAC) is a framework for aspect-oriented sofware development in Java.',290,'2011-11-01 13:48:49'),('jasmine','JASMINe is an administration tool for the SOA platform aiming to simplify the administrator\'s job and reduce the management costs. It relies on an autonomic system (Jade project) for implementing some autonomous behaviors (self-repair, self-healing).',290,'2011-11-01 13:48:49'),('jaspte','Bench4Q is a QoS oriented B2C benchmark for Internet Middleware. It makes many extensions of TPC-W, especially for load simulation and metrics analysis of a benchmark. This project is hosted on the Trustie forge, operated by the OW2 China Local Chapter.',290,'2011-11-01 13:48:49'),('javaservice','JavaService allows server-type Java programs to be run in the background as a Windows NT/2000/XP system service (aka Unix daemon process).',290,'2011-11-01 13:48:49'),('jeffree','Java Embedded Framework Free. Based on OSGi v2.0 specification.',290,'2011-11-01 13:48:49'),('jibx2','JiBX 2 is a new generation of the JiBX XML data binding tool for Java. JiBX is widely used for high-performance XML applications in Java, including web services using either Apache Axis2 or JiBX/WS stacks (and, in the future, Apache CXF).',290,'2011-11-01 13:48:49'),('jnetcontrol','Management and configuring network equipment with support to Telnet protocol ie: Cisco tm, 3COM.',290,'2011-11-01 13:48:49'),('jonas-doc','The jonas-doc project goal is to hold JOnAS documentation translations. The repository will contain one directory per language (French -&gt; jonas-doc-fr, German -&gt; jonas-doc-de, ...).',290,'2011-11-01 13:48:49'),('jonathan','Jonathan is an open source adaptable distributed object platform, which currently provides several personalities, including on compliant with the OMG CORBA specifications and another with the RMI specification.',290,'2011-11-01 13:48:49'),('joram','JORAM (Java Open Reliable Asynchronous Messaging) is an open source implementation of the JMS (Java Message Service) 1.1 API.',290,'2011-11-01 13:48:49'),('jorm','JORM (Java Object Repository Mapping) is an open source adaptable persistence service.',290,'2011-11-01 13:48:49'),('jotm','JOTM (Java Open Transaction Manager) is a fully functional open source standalone transaction manager that implements the XA protocol and is compliant with the JTA APIs.',290,'2011-11-01 13:48:49'),('jsurvey','The purpose of JSurvey is to provide tools for building online survey based on Java (J2EE) technologies. For the moment JSurvey is a started project so there is only a cvs repository with the sources of an online graphical survey example. see the cvs REA',290,'2011-11-01 13:48:49'),('kalimucho','Kalimucho  is a platform that allows dynamic deployment and dynamic reconfiguration of applications on desktops, laptops and mobile devices with java and/or Android.',290,'2011-11-01 13:48:49'),('kalimuxo','Kalimucho  is a platform that allows dynamic deployment and dynamic reconfiguration of applications on desktops, laptops and mobile devices with java and/or Android.',290,'2011-11-01 13:48:49'),('kelp','This project has moved to https://sites.google.com/a/together.at/www/prod/tools/tep . Please update your links !',290,'2011-11-01 13:48:49'),('kilim','Kilim is a generic configuration framework based on the concept of configuration by software assembly.',290,'2011-11-01 13:48:49'),('kilim2','This project has not yet submitted a description.',290,'2011-11-01 13:48:49'),('lemonldap','LemonLDAP::NG is a single sign on handler for Apache web server. It manages several levels of cache and gets authentication data from an LDAP directory.',290,'2011-11-01 13:48:49'),('lewys','LeWYS hosts a number of frameworks related to monitoring, based on OW2 Fractal component model. It contains a primary module called lewys, a Fractal monitoring framework providing a library of probes for both hardware and software resources.',290,'2011-11-01 13:48:49'),('lomboz','Lomboz is an eclipse plug-in for J2EE developers by extending eclipse JDT. It employs some of the proven open-source technologies. Supporting the complete development cycle: Code, deploy, test and debug.',290,'2011-11-01 13:48:49'),('maven','This project is used to manage the ObjectWeb\'s Maven Repository (maven.objectweb.org) which allows project managers using maven to use a commmon repository.',290,'2011-11-01 13:48:49'),('mesh','Mesh is a proxy for a remote JDBC driver, which can be accessed as though it were local. ',290,'2011-11-01 13:48:49'),('mind','MIND is an implementation of the Fractal component model for the development of embedded softwares. It provides an architecture compilation tool-chain, a component library and an integrated development environment based on Eclipse.',290,'2011-11-01 13:48:49'),('modfact','(Model Factory) is a Tool Box for the MDA(TM) (Model Driven Architecture)',290,'2011-11-01 13:48:49'),('navilis','Xcalia NAViLIS Web allows a developer to browse, query for, create, update, and delete business objects that are mapped to a live database. NAViLIS Web is like a database browser, except that the user navigates Java objects instead of database tables.',290,'2011-11-01 13:48:49'),('newsadmin','This project has not yet submitted a description.',290,'2011-11-01 13:48:49'),('noah','Noah is an implementation of an Interaction Service. &lt;br&gt;Interactions between components are described using a specific language (ISL). &lt;br&gt;Successive Adaptations are merged in a commutative and associative way.',290,'2011-11-01 13:48:49'),('nuxeo','Nuxeo provides a modular, extensible Java-based open source software platform for enterprise content management (ECM) and packaged applications for document management, digital asset management and case management. More info: www.nuxeo.com.',290,'2011-11-01 13:48:49'),('ocelot','OCELOT is an Open Collaborative Environment for the Leverage of Online insTrumentation. It is a Framework to easily create and deploy collaborative-based applications in order to operate one or several real remote devices over the Internet.',290,'2011-11-01 13:48:49'),('octopus','This project has moved to http://www.together.at/prod/database/tdt . Please update your links !',290,'2011-11-01 13:48:49'),('ofccharts','OFC Charts fills the need for publishing reports and statistics in graphical format such as curves and histograms. Fully written in JAVA and compatible with all popular IDEs it creates graphics in industry standard JPEG, PNG and SVG formats.',290,'2011-11-01 13:48:49'),('oncepi','As an Integration-Oriented business process management system, OncePI project provides a platform to construct dynamic process flexibly and efficiently.',290,'2011-11-01 13:48:49'),('oncess','OnceSS is for service selection for business process. It can optimize the QoS of bussiness process. This project is hosted on the Trustie forge, operated by the OW2 China Local Chapter.',290,'2011-11-01 13:48:49'),('opalval','Project for validation of ow2 forge',290,'2011-11-01 13:48:49'),('openediint','Open EDIINT is an open source implementation of EDIINT standards. It provides a component library and tools to build applications that allow companies to integrate with their partners, making Electronic Data Interchange over the Internet.',290,'2011-11-01 13:48:49'),('openmobileis','Open Mobile IS is a Java framework that aim to provide all the functionalities and components needed for the developpement of entreprise mobile application.',290,'2011-11-01 13:48:49'),('ops','Orbeon Forms is an open source forms solution that handles the complexity of forms typical of the enterprise or government. It is delivered to standard web browsers thanks to XForms and Ajax technology, with no need for client-side software or plugins.',290,'2011-11-01 13:48:49'),('orchestra','Orchestra is a Web Service Orchestration Suite based on the OASIS standard BPEL (Business Process Execution Language). ',290,'2011-11-01 13:48:49'),('orientwareccm','A CCM implementation in C++',290,'2011-11-01 13:48:49'),('osa-interop','The OSA CCV Project provides software, tools, collatoral and guidelines for interoperability of OSA and OW2 projects and vendors. It leverages the 3 year effort by OSA to demonstrate project interoperability.',290,'2011-11-01 13:48:49'),('oslcv3','Open Source License Checker V.3 is tool for inspection and analysis of license information from open source packages.',290,'2011-11-01 13:48:49'),('oyster','Enhydra Oyster is a Java library for SMIME signing and encryption using different key strengths and algorithms. It is developed with suport and testing for major E-Mail clients.',290,'2011-11-01 13:48:49'),('paje','PajÃ© is now hosted in SourceForge.net [ http://paje.sourceforge.net ].',290,'2011-11-01 13:48:49'),('pargres','ParGRES is a Database Cluster Middleware whose main goal is to efficiently process heavy-weight queries (e.g. OLAP). Our query processing combines intra and inter-query parallelism, while using replication and virtual fragmentation over a PC cluster.',290,'2011-11-01 13:48:49'),('petals','The PETALS Services Platform provides a distributed open source implementation of Java Business Integration (JBI) spec as a core element to build OW2 ESB solutions, leveraging existing Consortium s components.',290,'2011-11-01 13:48:49'),('pkuas','JOnAS PKU is a light-weight application server prototype. It functions as component operating platform based on Java/J2EE technology. It aims at exploring advanced middleware features like easy of management, flexibility, and open to change.',290,'2011-11-01 13:48:49'),('polyorb','PolyORB is a schizophrenic middleware that has an original architecture decoupling protocol personalities from application personalities. PolyORB enables in the same middleware: configurability, genericity and M2M.',290,'2011-11-01 13:48:49'),('rfid','RFID project is a collection of RFID related components and middleware available from ObjectWeb s software stack.',290,'2011-11-01 13:48:49'),('rubbos','RUBBoS is a bulletin board benchmark modeled after an online news forum like Slashdot. It is used for design patterns and J2EE servers performance scalability evaluation. RUBBoS provides the essential bulletin board features such as discussion threads.',290,'2011-11-01 13:48:49'),('rubis','RUBiS is an auction site prototype modeled after eBay.com. It is used for design patterns and J2EE servers performance scalability evaluation.',290,'2011-11-01 13:48:49'),('s4allsdk','S4All-SDK is a toolkit to build a Java standard based service oriented platform',290,'2011-11-01 13:48:49'),('salome-tmf','SalomeTMF is a test management tool, aiming to provide an open framework allowing, the automatic tests execution, reports, and the management of defects/requirements. In 2010 ACPQualife take the lead of the project. http://www.Acpqualife.com/',290,'2011-11-01 13:48:49'),('scarbo','Scarbo brings technology agnostic Business Process design and execution to your service architecture. Built on Eclipse Java Workflow Tooling (JWT) and the Frascati SCA platform, it supports the Nova Bonita workflow engine while being open to others.',290,'2011-11-01 13:48:49'),('sequencer','The Sequencer is a smart command launcher that executes commands  according to dependency rules taking failure into account. It is traditionally used for starting/stopping a wide set of hardware such as a whole cluster or a data-center.',290,'2011-11-01 13:48:49'),('shark','This project has moved to http://www.together.at/prod/workflow/tws . Please update your links !',290,'2011-11-01 13:48:49'),('simpledbm','The goal of SimpleDBM project is to build a Relational Database Manager in Java.',290,'2011-11-01 13:48:49'),('snap','CloudSNAP is a Java EE application deployment transparent infrastructure for structured p2p overlay networks. Developers can use the services the framework provides, thus forgetting about persistence, security, load balancing, failover and others.',290,'2011-11-01 13:48:49'),('snapper','This project has moved to http://www.together.at/prod/docmgmt/tss . Please update your links !',290,'2011-11-01 13:48:49'),('spago','Spago is a J2EE framework that provides a solution to the needs of multichannel applications and integration services. It allows to develop web applications,integrating existing infrastructures and publishing the services on different channels.',290,'2011-11-01 13:48:49'),('spago4q','Spago4Q  is a platform for assessing the maturity of the software development process and product, by evaluating data and measures collected from the development tools with non-invasive techniques, in order to improve the overall quality.',290,'2011-11-01 13:48:49'),('spagobi','SpagoBI is a Business Intelligence Free Platform which uses many FOSS tools as analytical engines, integrating them in an infrastructure which offers a cross-operativeness and a consistent vision between Report,OLAP,Data Mining,Dashboard and over the DWH',290,'2011-11-01 13:48:49'),('starwebservice','StarWebService is an independent platform for developing, deploying, managing and running Web Services.',290,'2011-11-01 13:48:49'),('stock-online','Stock-Online is the CSIRO application used to stress middleware performance and scalability. This open-source version is implemented in EJB 1.1, and provides two alternative design choices (Session bean + JDBC, and Session bean + CMP Entity beans).',290,'2011-11-01 13:48:49'),('surf','SURF (Fault Tolerance by Replication with Universal Services) is a Java library replication service for arbitrary deterministic objects. In crash situations objects can still be accessed with replication transparent to the application developer.',290,'2011-11-01 13:48:49'),('tess','TESS (Timestamped Event Stream System) is a framework designed to easily build complex event stream processing. CRS (Chronicle Recognition System) deploys a TESS processing architecture which implements a correlation rule engine from a set of chronicles.',290,'2011-11-01 13:48:49'),('think','THINK is a software framework for building component-based system kernels. As an implementation of the Fractal model, it clearly separates architectural from functional apects, provides flexibility, encourages code re-use and reduces development time.',290,'2011-11-01 13:48:49'),('tox','This project has not yet submitted a description.',290,'2011-11-01 13:48:49'),('tsrr','Trustie Software Resource Repository aims to provide a trustworthy software resource management mechanism and a software resources sharing environment. This project is hosted on the Trustie forge, operated by the OW2 China Local Chapter.',290,'2011-11-01 13:48:49'),('wcms','This project has not yet submitted a description.',290,'2011-11-01 13:48:49'),('wildcat','WildCAT is a Java toolkit/framework to make applications context-aware. It provides a simple and dynamic data model to represent the execution context of the application, which can be accessed both synchronously and asynchronously (pull and push).',290,'2011-11-01 13:48:49'),('wsunit','WSUnit is a tool that can help you test Web Services. It provides a predictable and repeatable simulation of a Web Service that is ideal for unit testing.',290,'2011-11-01 13:48:49'),('xmlc','Enhydra XMLC radically simplifies web development by cleanly separating presentation from code.',290,'2011-11-01 13:48:49'),('xplus','xPlus is a implementation of the persistence provider of Enterprise Java Beans 3.0, also known as the Java Persistence API (JPA). It can be used as a stand-alone POJO persistence layer, or it can be integrated into any EJB3.0 compliant container.',290,'2011-11-01 13:48:49'),('xquare','The XQuare project provides a set of Java components for extending J2EE platforms with XML-based, heterogeneous information integration capabilities, using the XQuery language',290,'2011-11-01 13:48:49'),('xservice','XService suite, which is powered by ACT (The Institute of Advanced Computing Technology), Beihang University, Beijing, China, is a suite focus on web services and SOA, and provide fundamental element to enable service oriented computing(SOC).',290,'2011-11-01 13:48:49'),('xwiki','XWiki is a second-generation wiki. See http://xwiki.org for all details.',290,'2011-11-01 13:48:49'),('zeus','Open source Java-to-XML Data Binding tool.',290,'2011-11-01 13:48:49');
